import React from 'react';
import { Link } from 'react-router-dom';  // استيراد Link للتوجيه
import { Container, Row, Col, Form, Button, Card } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const Login = () => {
  return (
    <div style={{ backgroundColor: '#f7f7f7', minHeight: '100vh' }}>
      <Container className="d-flex justify-content-center align-items-center" style={{ minHeight: '100vh' }}>
        <Row className="w-100">
          <Col xs={12} sm={8} md={6} lg={5} className="mx-auto">
            <Card className="shadow-sm rounded p-4">
              <Card.Body>
                <h3 className="text-center mb-4">Login</h3>
                <Form>
                  {/* إضافة نموذج تسجيل الدخول هنا */}
                  <Button variant="primary" type="submit" className="w-100 mt-3">
                    Login
                  </Button>
                </Form>

                <div className="mt-3 text-center">
                  <p>
                    Don't have an account? <Link to="/register">Register here</Link> {/* رابط للتوجيه إلى صفحة التسجيل */}
                  </p>
                </div>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Login;
